import React, { Component } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

class Header extends Component {
    state = {
        level:5,
        race:"Half Elf",
        class:"Ranger",
        exp:1800
    }
    render() { 
        return (
            <div className="row">
                <input type="text" name="characterName" placeholder="Character Name"/>
                <div id="level">Level: {this.state.level}</div>
                <div id="race">Race: {this.state.race}</div>
                <div id="class">Class: {this.state.class}</div>
                <div id="exp">Exp: {this.state.exp}</div>  
            </div>
        );
    }
}
 
export default Header;
